/* 
1. Fetch data from API https://www.thesportsdb.com/api/v1/json/2/lookupplayer.php?id=34162040
2. The result should be like this: https://www.thesportsdb.com/player/34162040
*/


import React from "react";

export default class JugadoresPagina extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            Jugadores: []
        }

    }
    componentDidMount() {
        fetch("https://www.thesportsdb.com/api/v1/json/2/lookupplayer.php?id=34162040")

            .then((res) => res.json())
            .then((data) => {
                this.setState({
                 Jugadores: data.matches
                })
            })
            .catch((err) => console.log(err))


    }

    render() {
        return (
            <div className="container">
                <div className="row">
                    <div className="col">
                        <header class="header">
                            <div class="container">
                                <div class="row">
                                    <div class="col-lg-3">
                                        <div class="header-left">
                                            <img src="https://www.thesportsdb.com/images/media/player/thumb/8f5j5p1582326299.jpg" alt="" />
                                        </div>
                                    </div>
                                    <div class="col-lg-3">
                                        <div class="header">
                                            <h2 class="text">Lionel Messi</h2>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </header>
                        <table className="table table-striped">
                            <thead>
                                <tr>
                                    <th scope="col">Fecha</th>
                                    <th scope="col">Local</th>
                                    <th scope="col">Visitante</th>
                                </tr>
                            </thead>
                            <tbody>
                                {this.state.Jugadores.map((jugador) => (
                                    <tr>
                                        <td>{jugador.dateEvent}</td>
                                        <td>{jugador.strHomeTeam}</td>
                                        <td>{jugador.strAwayTeam}</td>
                                    </tr>
                                ))}
                            </tbody>
                        </table>
                    </div>
                </div>
            </div>
        )
    }
}
